import React, { useContext, useState } from 'react'
import Product from '../components/Product'

const Main = ({bikes}) => {
  
  return (
    <main className='main'>
        <div className='banner'>
          <h1 className='banner-text'>Enjoy and buy right now</h1>
        </div>
        {bikes.map(bike => <Product key={bike.id} bike={bike}/>)}
    </main>   
  )
}
export default Main
